import React from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Header() {
  const navigate = useNavigate();
  const token = localStorage.getItem("token");

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/");
  };

  return (
    <header className="bg-[#34A853] text-white">
      <div className="container mx-auto px-4 py-3 flex justify-between items-center">
        <Link to="/" className="text-xl font-bold">
          ParkingPartagé
        </Link>

        <nav className="flex items-center space-x-4">
          <Link to="/">Accueil</Link>

          {token ? (
            <>
              <Link to="/dashboard">Mon compte</Link>
              <Link to="/owner">Propriétaire</Link>
              <button onClick={handleLogout} className="bg-white text-[#34A853] px-3 py-1 rounded">
                Déconnexion
              </button>
            </>
          ) : (
            <>
              <Link to="/login">Connexion</Link>
              <Link to="/register" className="bg-white text-[#34A853] px-3 py-1 rounded">
                Inscription
              </Link>
            </>
          )}
        </nav>
      </div>
    </header>
  );
}
